--
-- Create procedure `Proc_GetFixedAssetsFilter`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_GetFixedAssetsFilter (IN $Keyword varchar(255),
IN $DepartmentId char(36),
IN $FixedAssetCategoryId char(36),
IN $PageIndex int, IN $PageSize int)
COMMENT 'Lọc danh sách tài sản
  Author: Tuan
  Date: 9/11/2022
  '
BEGIN
  DECLARE $Start int;

  -- Set giá trị mặc định
  IF $Keyword IS NULL THEN
    SET $Keyword = '';
  END IF;

  IF $PageSize IS NULL
    OR $PageSize <= 0 THEN
    SET $PageSize = 20;
  END IF;

  IF $PageIndex IS NULL
    OR $PageIndex <= 0 THEN
    SET $PageIndex = 1;
  END IF;

  -- SET điểm bắt đầu 
  SET $Start = ($PageIndex - 1) * $PageSize;

  -- Câu lệnh truy vấn
  SELECT
    fa.fixed_asset_id,
    fa.fixed_asset_code,
    fa.fixed_asset_name,
    fa.organization_id,
    fa.organization_code,
    fa.organization_name,
    fa.fixed_asset_category_id,
    fa.fixed_asset_category_code,
    fa.fixed_asset_category_name,
    fa.department_id,
    fa.department_code,
    fa.department_name,
    fa.purchase_date,
    fa.cost,
    fa.quantity,
    fa.depreciation_rate,
    fa.tracked_year,
    fa.life_time,
    fa.production_year,
    fa.active,
    fa.created_by,
    fa.created_date,
    fa.modified_by,
    fa.modified_date
  FROM fixed_asset fa
  WHERE (fa.fixed_asset_code LIKE CONCAT('%', $Keyword, '%')
  OR fa.fixed_asset_name LIKE CONCAT('%', $Keyword, '%'))
  AND fa.department_id LIKE IF($DepartmentId IS NOT NULL, $DepartmentId, '%')
  AND fa.fixed_asset_category_id LIKE IF($FixedAssetCategoryId IS NOT NULL, $FixedAssetCategoryId, '%')
  LIMIT $PageSize
  OFFSET $Start;
END
$$

--
